import React, { Component } from 'react'
import { Timeline, TimelineItem }  from 'vertical-timeline-component-for-react';

import Experience_001 from './experiences/Jan011994'
import Experience_002 from './experiences/Mar122020'
export default class Experience extends Component {
  render(){
    return(
      <div>
        // Before you go down the rabbit hole of my life, it's important that I tell you why it's organized the way it is.
        // <br />
        // I think of life as composed of a few different sections.
        // <ul>
        //   <li>Personal</li>
        //      <li>-- relationships (family, friendships, romantic)</li>
        //      <li>-- finances</li>
        //      <li>-- health</li>
        //      <li>-- spiritulality (meditation)</li>
        //   <li>Education</li>
        //   <li>Business (Career and Work)</li>
        //   <li>Athletics</li>
        //   <li>Volunteering/Community service</li>
        //   <li>Arts</li>
        // </ul>
        // Thinking of my life allows me to better myself in every area. Can you be split it further? 
        // <br />
        // Sure, but for me, there's almost no reason to. I can look at this, see how much time I spend on each of them,
        // and decide if I have my priorities straight or not.
        // <br />
        // <br />
        // Events will be composed of:
        // <ul>
        //   <li>Title</li>
        //   <li>Subtitle</li>
        //   <li>Date entered </li>
        //   <li>Date finished </li>
        //   <li>Location</li>
        //   <li>Company etc involved</li>
        //   <li>what did i actually do?</li>
        //   <li>ideally an image?</li>
        //   <li>Link to github or paper or whatever that may have </li>
        //   <li>Tags (e.g. personal project, work, school, award (star?)</li>
        //   <li>skills learned?</li>
        //   <li>blogs associated?</li>
        //   <li></li>
        // </ul>
        <Timeline lineColor={'#ddd'}>
          <Experience_001/>
          <Experience_002/>
        </Timeline>
      </div>
    )
  }
}
